import React from "react";

export default function RenderNames()
{
    const names = ["Georgi","Pesho", "Dido", "Nikola", "Asparuh"];

    function handleDelete(id)
    {
        console.log(5);
        names.splice(id,1)
    }
    return(
        <>
            <table>
                <tr>
                    <th>Name</th>
                    
                </tr>
                    {names.map((name, i) =><tr><td onClick={() =>handleDelete(i)} key={i}>{name}</td></tr>)}
            </table>
        </>
    )
}
